import React, { Fragment } from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import { deleteImmunize } from '../../actions/immunize';

const ImmunizeItem = ({
  deleteImmunize,
  auth,
  immunize: { _id,user,vaccineName },
  showActions
}) => (
  <div className="post bg-white p-1 my-1">
    <div>
      <Link to={`/profile/${user}`}>
        
      </Link>
    </div>
    <div>
      <p className="my-1">{vaccineName}</p>
    </div>
  </div>
);

ImmunizeItem.defaultProps = {
  showActions: true
};

ImmunizeItem.propTypes = {
  post: PropTypes.object.isRequired,
  deletePost: PropTypes.func.isRequired,
  showActions: PropTypes.bool
};

const mapStateToProps = (state) => ({
  auth: state.auth
});

export default connect(mapStateToProps, { deleteImmunize })(
  ImmunizeItem
);
